const express = require('express');
const axios = require('axios');
const Cashfree = require('cashfree-pg'); 

Cashfree.XClientId = "7008519896fc1d4cef3ba0670d158007";
Cashfree.XClientSecret = "cfsk_ma_prod_5b73916dbcd9cbe497c30e9f27ad7b5f_7987c49a";
Cashfree.CFEnvironment = Cashfree.CFEnvironment.PRODUCTION;

const app = express();
app.use(express.json());

app.post('/create-order', async (req, res) => {
    const request = {
        "order_amount": 1.00,
        "order_currency": "INR",
        "order_id": "order_" + Date.now(), // Unique order ID
        "customer_details": {
            "customer_id": "walterwNrcMi",
            "customer_phone": "7729862347"
        },
        "order_meta": {
            "return_url": "https://www.cashfree.com/devstudio/preview/pg/web/checkout?order_id={order_id}"
        }
    };

    try {
        const response = await Cashfree.PGCreateOrder("2023-08-01", request);
        res.json({ paymentSessionId: response.data.payment_session_id });
    } catch (error) {
        res.status(500).json({
            message: error.response ? error.response.data.message : error.message
        });
    }
});

export default Ser;
